INSERT INTO "public"."rule" ("id", "rule_name") VALUES
	(1, 'Pausing the game at any point during the "live" part of an attempt is considered cheating and will immediately invalidate any submission. The "live" part of an attempt is specifically from when the player first gains control of the monkey (the frame the timer begins ticking down, or the player gains control), up until, but not including, the first frame the goal tape is broken.'),
	(2, 'For charts in Practice Mode categories, please play in Practice Mode to achieve your high scores and fast times to avoid bugs present in other modes. The exception to this rule is if you achieved the high score/fast time in a different mode by accident.'),
	(3, 'For a submission to be officially recognized, and counted toward the official rankings, you must provide a live recording of your run. Providing only an in-game replay is not sufficient evidence to prove a submission. If you are unable to provide a live recording, a replay may still be submitted, but it will not be officially recognized.'),
	(4, 'Submission proofs must be of at least reasonable video quality in order to be verified, and runs may be rejected if the video quality is too poor. Please use common sense to judge what constitutes "reasonable video quality."'),
	(5, 'Game audio is required for live submissions. For users who are generally trusted, there may be occasional exceptions to this rule if the absence of game audio is a mistake.'),
	(6, 'Please submit the time you finished in Practice Mode, not the time displayed in the runs replay. There is an in-game error where times ending in .X1 or .X6 will display incorrectly as .X2 and .X7 respectively in the replay, so be mindful of this fact.'),
	(8, 'For bonus floors with no goal, the time chart tracks the fastest time to achieve a perfect score. Bonus floor replays do not track time, so live recordings are required to submit to these floors.'),
	(9, 'The NTSC and PAL versions of this game have slightly different physics, meaning times and scores between the two versions cannot be fairly compared, and are recorded in separate games: Super Monkey Ball 2 for NTSC versions, and Super Monkey Ball 2 PAL for PAL versions. Please ensure you are aware of which version of SMB2 you are playing on, and submit to the correct game.'),
	(11, 'The version you play on generally does not affect scores or times, as all versions are recorded on the same charts. However, it is highly suggested to play on PAL60 rather than PAL50, as 50Hz mode runs the game slower, and will always result in significantly lower, and incorrect, score calculations, making it much harder to compete. If you are unsure which mode you are playing in, you can tell by checking the decimal values of the in-game timer. In 50Hz mode, the timer displays .X0, .X2, .X4, .X6, and .X8, whereas in 60Hz mode, the timer displays .X0, .X1, .X3, .X5, .X6, and .X8.'),
	(12, 'It is highly suggested to play on PAL60 rather than PAL50, as 50hz mode runs the game slower, and will always result in significantly lower, and incorrect, score calculations, making it much harder to compete. If you are unsure which mode you are playing in, you can tell by checking the decimal values of the in-game timer. In 50Hz mode, the timer displays .X0, .X2, .X4, .X6, and .X8, whereas in 60Hz mode, the timer displays .X0, .X1, .X3, .X5, .X6, and .X8.'),
	(13, 'Emulator runs are strictly prohibited, and may not be submitted to any chart of this game.'),
	(14, 'The version you play on generally does not affect scores or times, as all versions are recorded on the same charts. However, it is highly suggested to play on PAL60 rather than PAL50, as 50Hz results in lower times than 60hz, making it much harder to compete. If you are unsure which mode you are playing in, you can tell by checking the decimal values of the in-game timer. In 50Hz mode, the timer displays .X0, .X2, .X4, .X6, and .X8, whereas in 60Hz mode, the timer displays .X0, .X1, .X3, .X5, .X6, and .X8.'),
	(7, 'If your hardware can handle it, runs performed on Dolphin emulator are allowed, but with additional restrictions. Firstly, you must be playing on a stable, up-to-date beta version of Dolphin emulator. You must additionally provide live proof with input display, using an analog joystick. Finally, you must have the following 4 options enabled in the "Movie" tab:
