	(15, 'When submitting a world record, please provide a live recording of the attempt, rather than recording the replay. Otherwise, replays are acceptable proof.'),
	(16, 'New submissions must be performed on version 1.1, which is the version linked on this page.'),
	(17, 'When playing on version 1.1, keep in mind that the game will crash when you try to view replays of the following stages:
