  - World 7-7 - Device
  - World 8-7 - Oscillating Overpass
  - World 10-2 - Smile
  - World 10-3 - Crank'),
	(18, 'Please play on the version linked on this page. An incorrect link of this game exists which is missing the first spinner on 3-1 Cycle Hit. If you downloaded from a MEGA link starting in ''RSJ'' rather than ''taY'', you have the wrong version.'),
	(19, 'If you are playing on console, keep in mind that the game will crash when you try to view replays of the following stages:
  - World 10-6 - Trick Room
  - World 10-8 - Red Sea'),
	(20, 'New submissions must be performed on version 1.2, which is the version linked on this page.'),
	(21, 'Camera swapping, at any point during an attempt, is strictly prohibited. You must perform the entire attempt in either SMB2 or SMB1 camera.'),
	(22, 'Submissions from versions 1.0 and 1.1 are both allowed, but it is suggested that you upgrade to version 1.1, as it fixes crash issues.'),
	(23, 'Pausing the game at any point during the "live" part of an attempt is considered cheating and will immediately invalidate any submission. The "live" part of an attempt is specifically from when the player first gains control of the monkey (the frame the timer begins ticking down, or the player gains control), up until, but not including, the first frame the goal tape is broken. The only exception for this rule is for switch activation prior to Switch Storage runs.'),
	(24, 'For floors using Switch Storage, live proof is a requirement, and replays will be rejected. In your submission, the live proof must show the activation of the switch and retry prior to the successful attempt, and your comment should mention that Switch Storage was used.'),
	(26, 'Cosmetic mods created through AssetBundle/sound file modification are permitted as long as they do not directly affect gameplay or provide an advantage over the vanilla game (examples of illegal mods include smaller than normal characters, hiding the character entirely, or sounds/textures that provide an advantage beyond what is normally available). If you''re unsure about the legality of a cosmetic mod you have installed, ask a game moderator.'),
	(27, 'BananaModManager must be set to ''Speedrun Mode'' ON when in use during runs. Only approved speedrun-safe mods may be used in IL/RTA submissions (with the exception of NoPrompt, which is only allowed in ILs). For a full list of safe-to-use mods, visit this link:
	https://github.com/MorsGames/BananaModManager/blob/main/LegalMods.md'),
	(25, 'Replays always finish on a time one frame slower than what was originally achieved. When submitting a replay, submit a time one frame higher than what is shown in-game. Keep in mind the timer can only end in the following numbers: 0, 1, 3, 5, 6, and 8.'),
	(28, 'For submissions to Monkey Race charts, your proof must be a live recording.'),
	(29, 'For submissions to Monkey Race charts, your proof must be a live recording. Submissions to the glitch charts that use the 0.01 lap glitch will not be accepted.'),
	(30, 'Submissions to sweep charts that do not collect all bunches will be rejected.'),
	(32, 'Runs achieved on the original Supernova ISO can be submitted to the Supernova charts of this game.'),
	(33, 'The use of the Super Blocky Mode cheat code is prohibited for all charts.'),
	(34, 'Using Save & Quit during Normal Mode submissions is prohibited.'),
	(35, 'You are allowed to turn off music and SFX through the in-game menu.'),
	(36, 'If you are using a custom monkey, please select ''Custom'' as the monkey of your submission.'),
	(37, 'For a submission to be officially recognized, and counted toward the official rankings, you must provide a live recording of your run. If you are unable to provide a live recording, your run will not be officially recognized. In the case of longer levels for Switch users without a capture card, 30-second Switch capture clips may be submitted as long as the Goal entry is featured. Xbox and PS4/5 users must set live recording settings to at least the previous minute.'),
	(38, 'For PC players, please specify if you are using a non-default Ball Shape in your submission comments.'),
	(39, 'BananaModManager and use of the Practice Mod are permitted for ILs. Any runs that make use of other code injection mods that directly affect gameplay will not be accepted under any circumstances.'),
	(40, 'Pausing the game at any point during the "live" part of an attempt is considered cheating and will immediately invalidate any submission. The "live" part of an attempt is specifically from when the player first gains control of the monkey (the frame the timer begins ticking down, or the player gains control), up until the frame the timer stops ticking down.'),
	(41, 'Race ILs must be performed in 1P Mode with 1 CPU enabled. This will offer the closest approxmiation of a Time Trial environment for the game mode. Race charts are split into Item and Itemless charts, so please submit accordingly.'),
	(42, 'Local Multiplayer submissions are not permitted. Runs must be performed in Single Player mode only.'),
	(43, 'Do not submit the Clear Time shown in the book after completing a level. Rather, submit the time that appears on the timer after passing through the goal.'),
